// import get from '../../common/utils/CommonUtils'

class MovieDataBean {
  sort: number;

  /**
   * Is show sort image
   */
  isShowSort: boolean;

  /***
   * Movie sort image
   */
  sortImage: Resource;

  /**
   * Movie title
   */
  title: string;

  /**
   * Movie describe
   */
  describe: string;

  /**
   * Movie image
   */
  movieImage: Resource;

  /**
   * Show card image
   */
  cardImage: string;

  /**
   * Movie stars
   */
  stars: Resource[];

  /**
   * Movie rating
   */
  rating: string;

  /**
   * Movie introduction
   */
  introduction: string;
}

