  topIndex: number;
  topMovieImage: string;
  topTitle: string;
  topDescribe: string;
  bottomIndex: number;
  bottomMovieImage: string;
  bottomTittle: string;
  bottomDescribe: string;
}

let agencyStorage = new LocalStorage();

@Entry(agencyStorage)
@Component
struct DemoCard {
  readonly TITLE: string = 'Hello World';

