          left: $r('app.float.contents_layout_left'),
          right: $r('app.float.contents_layout_right')
        })
      }.onClick(() => {
        this.jumpToAbility(this.topIndex);
      })

      Row() {
        Stack({ alignContent: Alignment.TopStart }) {
          Image(this.bottomMovieImage)
